(1, '016d7-bb-cover-2.png', 'c3987-bb-cover-3.png', '', '', '', '', '', '', '', '', '', 'Kualitas merupakan hal yang penting dalam kelangsungan bisnis. <br/>Kami ingin menghadirkan \nhal yang sesuai dengan kebutuhan dan juga keinginan Anda.', 'RAKIT DAN RANCANG SENDIRI', 'Pada fitur ini anda dapat dengan mudah merakit komputer idaman anda dengan bebas memilih secara bebas komponen pada komputer yang dapat disesuaikan oleh keinginan serta budget anda. barang yang ditampilkan pada website kami merupakan barang yang PASTI ADA (READY STOCK) dan Pasti cocok dengan komponen komponen yang telah anda pilih sebelumnya. jadi anda tidak perlu ragu akan ketidaksesuaian komponen yang anda pilih. Pengiriman cepat berlaku pada opsi ini.', 'PAKETAN', 'Opsi ini merupakan hasil dari rancangan kami yang recomended untuk anda. Spesifikasi terebut telah memperhitungkan kecepatan CPU, GPU, RAM dan Hardisk sehingga tidak mengakibatkan bottleneck. Barang yang kami tampilkan merupakan barang yang on stock.', 'Tentang Kami', 'PT KARYA RAKIT PERSADA dengan Rakit.co.id ingin menciptakan pengalaman berbelanja yang lebih menarik. Bayangkan, anda dapat membuat komputer idaman anda tanpa harus beranjak dari rumah. Melalui pengalaman kami selama 8 tahun di dunia komputer, kami yakin kami dapat menjadi e-commerce yang terdepan.', 'Testimonial', 'Kami siap untuk memberikan produk dan pelayanan yang baik untuk Anda.  <br/> Apa kata mereka mengenai pelayanan dan produk kami.');
