INSERT INTO `letter_templates` (`id`, `name`, `columns`, `body`, `header`, `footer`, `block`) VALUES
(1, 'good', 1, '<!doctype html>\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n\n<title>Responsive Email Template</title>\n\n<style type=\"text/css\">\n	.ReadMsgBody {width: 100%; background-color: #ffffff;}\n	.ExternalClass {width: 100%; background-color: #ffffff;}\n	body	 {width: 100%; background-color: #ffffff; margin:0; padding:0; -webkit-font-smoothing: antialiased;font-family: Georgia, Times, serif}\n	table {border-collapse: collapse;}\n\n	@media only screen and (max-width: 640px)  {\n					body[yahoo] .deviceWidth {width:440px!important; padding:0;}\n					body[yahoo] .center {text-align: center!important;}\n			}\n\n	@media only screen and (max-width: 479px) {\n					body[yahoo] .deviceWidth {width:280px!important; padding:0;}\n					body[yahoo] .center {text-align: center!important;}\n			}\n\n</style>\n</head>\n\n<body leftmargin=\"0\" topmargin=\"0\" marginwidth=\"0\" marginheight=\"0\" yahoo=\"fix\" style=\"font-family: Georgia, Times, serif\">\n\n<!-- Wrapper -->\n<table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"center\">\n	<tr>\n		<td width=\"100%\" valign=\"top\" bgcolor=\"#ffffff\" style=\"padding-top:20px\">\n\n			<!-- Start Header-->\n			<table width=\"580\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"center\" class=\"deviceWidth\" style=\"margin:0 auto;\">\n				<tr>\n					<td width=\"100%\" bgcolor=\"#ffffff\">\n\n                            <!-- Logo -->\n                            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"left\" class=\"deviceWidth\">\n                                <tr>\n                                    <td style=\"padding:10px 20px\" class=\"center\">\n                                        <a href=\"#\"><img src=\"https://www.emailonacid.com/images/blog_images/Emailology/2013/logo2.jpg\" alt=\"\" border=\"0\" /></a>\n                                    </td>\n                                </tr>\n                            </table><!-- End Logo -->\n\n                            <!-- Nav -->\n                            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"right\" class=\"deviceWidth\">\n                                <tr>\n                                    <td class=\"center\" style=\"font-size: 13px; color: #272727; font-weight: light; text-align: right; font-family: Georgia, Times, serif; line-height: 20px; vertical-align: middle; padding:10px 20px; font-style:italic\">\n                                        <a href=\"#\" style=\"text-decoration: none; color: #3b3b3b;\">Products</a>\n                                        &nbsp;&nbsp;&nbsp;\n                                        <a href=\"#\" style=\"text-decoration: none; color: #3b3b3b;\">Services</a>\n                                        &nbsp;&nbsp;&nbsp;\n                                        <a href=\"#\" style=\"text-decoration: none; color: #3b3b3b;\">Pricing</a>\n                                        &nbsp;&nbsp;&nbsp;\n                                        <a href=\"#\" style=\"text-decoration: none; color: #3b3b3b;\">Contact</a>\n                                    </td>\n                                </tr>\n                            </table><!-- End Nav -->\n\n					</td>\n				</tr>\n			</table><!-- End Header -->\n\n			<!-- One Column -->\n			<table width=\"580\"  class=\"deviceWidth\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"center\" bgcolor=\"#eeeeed\" style=\"margin:0 auto;\">\n				<tr>\n					<td valign=\"top\" style=\"padding:0\" bgcolor=\"#ffffff\">\n						<a href=\"#\"><img  class=\"deviceWidth\" src=\"https://www.emailonacid.com/images/blog_images/Emailology/2013/free_template_1/headliner.jpg\" alt=\"\" border=\"0\" style=\"display: block; border-radius: 4px;\" /></a>\n					</td>\n				</tr>\n                <tr>\n                    <td style=\"font-size: 13px; color: #959595; font-weight: normal; text-align: left; font-family: Georgia, Times, serif; line-height: 24px; vertical-align: top; padding:10px 8px 10px 8px\" bgcolor=\"#eeeeed\">\n\n                        <table>\n                            <tr>\n                                <td valign=\"top\" style=\"padding:0 10px 10px 0\">\n                                    <img  src=\"https://www.emailonacid.com/images/blog_images/Emailology/2013/free_template_1/1.jpg\" alt=\"\" border=\"0\" align=\"left\" />\n                                </td>\n                                <td valign=\"middle\" style=\"padding:0 10px 10px 0\"><a href=\"#\" style=\"text-decoration: none; color: #272727; font-size: 16px; color: #272727; font-weight: bold; font-family:Arial, sans-serif \">One Column</a>\n                                </td>\n                            </tr>\n                        </table>\n\n						%content%\n                    </td>\n                </tr>\n			</table><!-- End One Column -->\n\n<div style=\"height:35px;margin:0 auto;\">&nbsp;</div><!-- spacer -->\n\n\n			<!-- 4 Columns -->\n			<table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" align=\"center\">\n				<tr>\n					<td bgcolor=\"#363636\" style=\"padding:30px 0\">\n                        <table width=\"580\" border=\"0\" cellpadding=\"10\" cellspacing=\"0\" align=\"center\" class=\"deviceWidth\" style=\"margin:0 auto;\">\n                            <tr>\n                                <td>\n                                        <table width=\"45%\" cellpadding=\"0\" cellspacing=\"0\"  border=\"0\" align=\"left\" class=\"deviceWidth\">\n                                            <tr>\n                                                <td valign=\"top\" style=\"font-size: 11px; color: #f1f1f1; color:#999; font-family: Arial, sans-serif; padding-bottom:20px\" class=\"center\">\n\n                                                    You are receiving this email because<br/>\n                                                    1.) You\'re an awesome customer of \"Company Name\" or<br/>\n                                                    2.) You subscribed via <a href=\"\" style=\"color:#999;text-decoration:underline;\">our website</a><br/>\n\n                                                    <br/><br/>\n                                                    Want to be removed? No problem, <a href=\"\" style=\"color:#999;text-decoration:underline;\">click here</a> and we won\'t bug you again.\n\n                                                </td>\n                                            </tr>\n                                        </table>\n\n                                        <table width=\"40%\" cellpadding=\"0\" cellspacing=\"0\"  border=\"0\" align=\"right\" class=\"deviceWidth\">\n                                            <tr>\n                                                <td valign=\"top\" style=\"font-size: 11px; color: #f1f1f1; font-weight: normal; font-family: Georgia, Times, serif; line-height: 26px; vertical-align: top; text-align:right\" class=\"center\">\n\n                                                    <a href=\"\"><img src=\"https://www.emailonacid.com/images/emails/5_13/footer_rss.gif\" width=\"42\" height=\"42\" alt=\"RSS Feed\" title=\"RSS Feed\" border=\"0\" /></a>\n\n                                                    <a href=\"\"><img src=\"https://www.emailonacid.com/images/emails/5_13/footer_twitter.gif\" width=\"42\" height=\"42\" alt=\"Twitter\" title=\"Twitter\" border=\"0\" /></a>\n\n                                                    <a href=\"\"><img src=\"https://www.emailonacid.com/images/emails/5_13/footer_vm.gif\" width=\"42\" height=\"42\" alt=\"Vimeo\" title=\"Vimeo\" border=\"0\" /></a>\n\n                                                    <a href=\"\"><img src=\"https://www.emailonacid.com/images/emails/5_13/footer_fb.gif\" width=\"42\" height=\"42\" alt=\"Facebook\" title=\"Facebook\" border=\"0\" /></a>\n                                                    <br />\n\n                                                    <a href=\"#\"><img src=\"https://www.emailonacid.com/images/blog_images/Emailology/2013/footer_logo2.jpg\" alt=\"\" border=\"0\" style=\"padding-top: 5px;\" /></a><br/>\n                                                    <a href=\"#\" style=\"text-decoration: none; color: #848484; font-weight: normal;\">555-555-5555</a><br/>\n                                                    <a href=\"#\" style=\"text-decoration: none; color: #848484; font-weight: normal;\">email@email.com</a>\n                                                </td>\n                                            </tr>\n                                        </table>\n\n                        		</td>\n                        	</tr>\n                        </table>\n                    </td>\n                </tr>\n            </table><!-- End 4 Columns -->\n\n		</td>\n	</tr>\n</table> <!-- End Wrapper -->\n<div style=\"display:none; white-space:nowrap; font:15px courier; color:#ffffff;\">\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\n</div>\n</body>\n</html>\n', '', '', ''),
(2, 'Minty', 1, 'vvvv', '<html xmlns=\"http://www.w3.org/1999/xhtml\"><head>\n      <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\">\n      <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n      <title>Minty-Multipurpose Responsive Email Template</title>\n      <style type=\"text/css\">\n         /* Client-specific Styles */\n         #outlook a {padding:0;} /* Force Outlook to provide a \"view in browser\" menu link. */\n         body{width:100% !important; -webkit-text-size-adjust:100%; -ms-text-size-adjust:100%; margin:0; padding:0;}\n         /* Prevent Webkit and Windows Mobile platforms from changing default font sizes, while not breaking desktop design. */\n         .ExternalClass {width:100%;} /* Force Hotmail to display emails at full width */\n         .ExternalClass, .ExternalClass p, .ExternalClass span, .ExternalClass font, .ExternalClass td, .ExternalClass div {line-height: 100%;} /* Force Hotmail to display normal line spacing.  More on that: http://www.emailonacid.com/forum/viewthread/43/ */\n         #backgroundTable {margin:0; padding:0; width:100% !important; line-height: 100% !important;}\n         img {outline:none; text-decoration:none;border:none; -ms-interpolation-mode: bicubic;}\n         a img {border:none;}\n         .image_fix {display:block;}\n         p {margin: 0px 0px !important;}\n         \n         table td {border-collapse: collapse;}\n         table { border-collapse:collapse; mso-table-lspace:0pt; mso-table-rspace:0pt; }\n         /*a {color: #e95353;text-decoration: none;text-decoration:none!important;}*/\n         /*STYLES*/\n         table[class=full] { width: 100%; clear: both; }\n         \n         /*################################################*/\n         /*IPAD STYLES*/\n         /*################################################*/\n         @media only screen and (max-width: 640px) {\n         a[href^=\"tel\"], a[href^=\"sms\"] {\n         text-decoration: none;\n         color: #ffffff; /* or whatever your want */\n         pointer-events: none;\n         cursor: default;\n         }\n         .mobile_link a[href^=\"tel\"], .mobile_link a[href^=\"sms\"] {\n         text-decoration: default;\n         color: #ffffff !important;\n         pointer-events: auto;\n         cursor: default;\n         }\n         table[class=devicewidth] {width: 440px!important;text-align:center!important;}\n         table[class=devicewidthinner] {width: 420px!important;text-align:center!important;}\n         table[class=\"sthide\"]{display: none!important;}\n         img[class=\"bigimage\"]{width: 420px!important;height:219px!important;}\n         img[class=\"col2img\"]{width: 420px!important;height:258px!important;}\n         img[class=\"image-banner\"]{width: 440px!important;height:106px!important;}\n         td[class=\"menu\"]{text-align:center !important; padding: 0 0 10px 0 !important;}\n         td[class=\"logo\"]{padding:10px 0 5px 0!important;margin: 0 auto !important;}\n         img[class=\"logo\"]{padding:0!important;margin: 0 auto !important;}\n\n         }\n         /*##############################################*/\n         /*IPHONE STYLES*/\n         /*##############################################*/\n         @media only screen and (max-width: 480px) {\n         a[href^=\"tel\"], a[href^=\"sms\"] {\n         text-decoration: none;\n         color: #ffffff; /* or whatever your want */\n         pointer-events: none;\n         cursor: default;\n         }\n         .mobile_link a[href^=\"tel\"], .mobile_link a[href^=\"sms\"] {\n         text-decoration: default;\n         color: #ffffff !important; \n         pointer-events: auto;\n         cursor: default;\n         }\n         table[class=devicewidth] {width: 280px!important;text-align:center!important;}\n         table[class=devicewidthinner] {width: 260px!important;text-align:center!important;}\n         table[class=\"sthide\"]{display: none!important;}\n         img[class=\"bigima